text:
allow, give yourself the chance, the permission from within to finally be what you are. stop pleasing the world, stop living the definitions of their good and bad, stop fulfilling self proclaimed prophecies, stop giving space to things that don’t belong in you, around you. stop over sacrificing, stop reasoning everything as ‘it’s okay’ when it’s certainly not, stop blaming yourself for things you cannot control, stop living on terms and conditions of society and caging your free heart and soul, stop justifying bad behavior and hurt people cause you, stop putting yourself second, third, fourth over and over again, stop covering up pain, stop silencing your voice, stop bottling up your emotions, stop wrapping another dream and tucking it under the pillow, stop muffling the cries, the screams, the power inside, stop entertaining toxic people, relationships, family, friends.. stop.. stop .. stop .. pause .. breathe .. and let yourself feel just for once.. allow yourself to feel all that you had been ignoring, neglecting, suppressing for so long. you just have one life to live, just like everybody else.. ( give that a thought ) ————————————
#anjumchoudhary
@theanjumchoudhary

