text:
we all have our demons to defeat. #bloodofjesus fact is many of us (myself included) have stared down death - eye to eye.............. the only way im still alive is proof of the eternal love of god. ..........................................
if you are in immediate danger dial 911 (usa) or if you are having self-harming thoughts & need immediate help call the national suicide prevention hotline 1-800-273-8255 (united states) .......................,,,,,,,,,,,,,,
if you are reading this in another country stop and google search a hotline in your area. talk to someone. don’t sit in silence and torment. don’t listen to the voices. get out of your own head and call now! .............................................. back in 2014........ i called my homie... i dunno what i sed that triggered him to call... but i remember him getting off the phn w me real quick & whn the phn rang.. i picked up slurring like “yo.. y u hang up..” and it was an angel from  @national_suicide_prevention and when i heard the callers voice.. so full of love and concern.. it broke me........ it was like my heart finally cracked all the way apart... i was so bad and in immediate danger of an od that (with my permission) they sent me help str8 to my highrise and saved my life.......... sidenote: i had just brought a baby blue clk550 lik the day or two b4 this........ so “status” or “success” or “new money” or material gain don’t make u immune... look how many being found dead in they cribs......... some of those be accidental od’s ..... gg too hard... tryn numb out...... we can all die anytime.. life is so fragile... and i promise when u come out of it you gone feel re-born mannn... like a 2nd chance at life to get it right... aiite.. #musicindustry #indieartist #overdose #drugs #artistoninstagram #hellotokindness 🎬  #realtalk peace #gethelp #psa #bossbabe #selflove #selfcare #metoo #suicideawareness #prevention #addiction #alcoholic #mentalhealth #molly #bipolar #depression #domesticviolence #heroinaddiction #meth #crackcocaine #opiodcrisis #youarenotaline #psa #jesuslovesyou #intervention

