bollywood's  reckoning: 'we  it would take 20 more years' - in  ⠀
introducing the recent series opener of india’s top-rated talk show, koffee with karan, the director-producer-personality karan johar championed bollywood’s new-found “girl power”: 12 months of successes – such as the taut spy thriller raazi and the raucous bridal comedy veere di wedding – that were led and authored by women. his guests, accordingly, were distaff royalty: reigning queen deepika padukone, newly radiant after surviving january’s trial-by-fire film padmaavat, and beaming princess alia bhatt, raazi’s immensely talented young lead. reclined on johar’s noonesque couch, bhatt was offered a cuddly sophie’s choice between her much-instagrammed cats and beau ranbir kapoor; padukone raised a suggestive eyebrow after asked what she first notices in a man.⠀
if the show’s peppy tone was enjoyable, it felt strangely removed from the grim claims emerging on social media from women occupying the film industry’s lower ranks. india’s  movement – initiated in early october and gathering rapid pace... see more:

